import {Container,Row,Col} from "react-bootstrap"

const Dashboard=()=>{
    return (
        <div>

  <Row>
    <Col style={{backgroundColor:"red"}} xs={6} md={4}>1 of 3</Col>
    <Col xs={12} md={8}>2 of 3 (wider)</Col>
  </Row>

        </div>
    )
}
export default Dashboard;
